import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import logo from './assets/images/logo.png';

class App extends React.Component {
  render() {
      return (
      <div className="fondo-app">
          <div className="fondo-app__app-bar flex">
            <img src={logo}/>
          </div>
          <div className="game-info">
          <div>{/* status */}</div>
          <ol>{/* TODO */}</ol>
          </div>
      </div>
      );
  }
}

class Login extends React.Component {
  constructor(props) {
    super(props);
    this.state = {nameValue: ''};
    this.state = {passValue: ''};
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleNameChange(event) {
    this.setState({nameValue: event.target.nameValue});    
  }
  handlePassChange(event) {
    this.setState({nameValue: event.target.passValue});    
  }
  handleSubmit(event) {
    alert('A name was submitted: ' + this.state.nameValue + this.state.passValue);
    event.preventDefault();
  }

  render() {
      return (
      <div className="fondo-app-login flex">
          <div>
            <img src={logo}/>             
          </div>       
          <form className='flex' onSubmit={this.handleSubmit}>
            <label><input type="text" value={this.state.nameValue} placeholder='Nombre Usuario' onChange={this.handleNameChange} /></label>
            <label><input type="text" value={this.state.passValue} placeholder='Clave' onChange={this.handlePassChange} /></label>
            <input type="submit" value="Submit" />
          </form>   
      </div>
      );
  }
}

ReactDOM.render(
    <Login />,
    document.getElementById('root')
);
